var refinedPets = pets.results.map( (pet) => ( {id: pet.data.id, name: pet.data.name.en_GB} ) )

var petString = "[\n"

refinedPets.forEach( element => petString += ("PetItem(id: " + element.id + ", name: \"" + element.name +"\"),\n" ))

petString = petString.slice(0,petString.length-2)

petString += "\n]"

function exportPets2txt() {

    const a = document.createElement("a");
    a.href = URL.createObjectURL(new Blob([petString], {
        type: "text/plain"
    }));
    a.setAttribute("download", "petsData.txt");
    document.body.appendChild(a);
    a.click();
    document.body.removeChild(a);
}